import logo from './logo.svg';
import './App.css';
import FirstTabs from './dashboard/FirstTabs.js'
import facebookIcon from './images/icon-facebook.svg'
import instagramIcon from './images/icon-instagram.svg'
import twitterIcon from './images/icon-twitter.svg'
import youtubeIcon from './images/icon-youtube.svg'

const firstTabs = [{
  icon: facebookIcon,
  user: '@nathanf',
  number: '1987',
  type: 'Followers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#1EB589" fill-rule="evenodd" d="M0 4l4-4 4 4z"/></svg>,
  isEnough: true,
  howMany: '12 Today',
},
{
  icon: twitterIcon,
  user: '@nathanf',
  number: '1044',
  type: 'Followers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#1EB589" fill-rule="evenodd" d="M0 4l4-4 4 4z"/></svg>,
  isEnough: true,
  howMany: '99 Today',
},
{
  icon: inst,
  user: '@realnathanf',
  number: '11k',
  type: 'Followers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#1EB589" fill-rule="evenodd" d="M0 4l4-4 4 4z"/></svg>,
  isEnough: true,
  howMany: '1099 Today',
},
{
  icon: <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20"><path fill="#C4032B" d="M10 0C4.478 0 0 4.478 0 10c0 5.523 4.478 10 10 10 5.523 0 10-4.477 10-10 0-5.522-4.477-10-10-10zm3.7 14.077c-1.75.12-5.652.12-7.402 0-1.896-.13-2.117-1.059-2.131-4.077.014-3.024.237-3.947 2.131-4.077 1.75-.12 5.652-.12 7.403 0 1.897.13 2.117 1.059 2.132 4.077-.015 3.024-.237 3.947-2.132 4.077zM8.334 8.048l4.098 1.949-4.098 1.955V8.048z"/></svg>,
  user: 'Nathan F.',
  number: '8239',
  type: 'Subscribers',
  upOrDown: <svg xmlns="http://www.w3.org/2000/svg" width="8" height="4"><path fill="#DC414C" fill-rule="evenodd" d="M0 0l4 4 4-4z"/></svg>,
  isEnough: false,
  howMany: '144 Today',
}]

function App() {
  return (
    <div className="App">
      <FirstTabs tabList={firstTabs}/>
    </div>
  );
}

export default App;
